import React, { Component } from "react";
import CardList from "./components/CardList";
import Card from "./components/Cards";
import "./App.css";
class App extends Component {
  render() {
    return (
      <div>
        <h2>{"this is from App"}</h2>
        <CardList />
        <Card />
      </div>
    );
  }
}
export default App;
